class CatalogIcons:
   iconDictionary = {
      'Undefined Actor': {'image': ';'},
      'Undefined Node': {'image': ';'},
      'Undefined Group': {'image': ';'}

   }
 
   common = None
 
   def __init__(self, common):
      self.common = common
 
   def getIconDictionary(self):
      return self.iconDictionary
 
   def getIcon(self, iconusage):
      if iconusage in self.iconDictionary:
         icon = self.iconDictionary[iconusage]
         image = icon['image']
      else:
         icon = self.iconDictionary['Undefined Node']
         image = icon['image']
      icon = 'image=data:image/svg+xml,' + image
      return icon
